angular.module("app",["app.student","app.student.config","app.home"]),
    angular.module("app.student",[]),
    angular.module("app.student.config",["ngRoute"])
    .config(["$routeProvider",function(t){
        t.when("/student",{
            controller:"studentController",
            templateUrl:"AngularCrud-ui-web/source/student/dashboard/studentView.html"})
    }]),
    angular.module("app.student")
    .controller("studentController",["$scope","studentService",function(e,t){
        t.getStudents().
        then(function(t){
            e.allStudents=t.data
        })
    }]),
    angular.module("app.home",[]),
    angular.module("app.home")
    .service("studentService",["$http",function(n){
        var u=" http://localhost:3000/Student";
        this.getStudents=function(){
            return n.get(u)},
            this.createStudent=function(t){
            return n.post(u,t)},
            this.deleteStudent=function(t){
            return n.delete(u+"/"+t)},
            this.editStudent=function(t){
            return n.get(u+"/"+t)},
            this.updateStudent=function(t,e){
            return n.put(u+"/"+t,e)}
    }]);